CREATE TABLE zomatoBI(
   Id                 INTEGER  NOT NULL PRIMARY KEY 
  ,Restaurant_name    VARCHAR(55) NOT NULL
  ,Online_ordering    VARCHAR(3) NOT NULL
  ,Table_booking      VARCHAR(3) NOT NULL
  ,Rating             NUMERIC(3,1) NOT NULL
  ,Votes              INTEGER  NOT NULL
  ,Location           VARCHAR(29) NOT NULL
  ,Restaurant_type    VARCHAR(29) NOT NULL
  ,Liked_dishes       VARCHAR(134) NOT NULL
  ,Cuisine            VARCHAR(84) NOT NULL
  ,Approx_costfor_two INTEGER  NOT NULL
  ,Type               VARCHAR(18) NOT NULL
);
